import React, { Component } from "react";
import { Button, View, Text } from "react-native";

export default function Home({ navigation }) {
  function handleLogin() {
    //console.log(this.props.history);
    fetch("http://192.168.0.176:9000/api/login", {
      method: "POST",
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        username: this.state.username,
        password: this.state.password,
      }),
    })
      .then((res) => res.json())
      .then((response) => {
        const token = response.token;
        this.setState({
          token: token,
        });
        localStorage.setItem("token", this.state.token);
        if (token != null) {
          this.setState({
            isLoggedIn: true,
          });
          //this.props.navigation.navigate("Fitnessinfo");
          // history.push("/FitnessInfoAdmin");
          console.log("Eingeloggt");
        } else {
          console.log("Nicht geklappt");
        }
      })

      .catch((err) => console.log(err));
  }
  return (
    <View style={{ flex: 1, alignItems: "center", justifyContent: "center" }}>
      <Text>Welcome!</Text>
      <Button
        title="Go to Fitnessinfo"
        onPress={() => navigation.navigate("Fitnessinfo")}
      />
      <Button
        title="Go to Fitnessplan"
        onPress={() => navigation.navigate("Fitnessplan")}
      />
      <Button
        title="Go to Login"
        onPress={() => navigation.navigate("Login", handleLogin)}
      />
    </View>
  );
}

